/**
	\file    FunctionSupportMacros.hpp
	\brief   Support Macros for the Function feature.
	\author  R. Kerviche
	\date    May 19th 2018
**/

	/* To generate the macro tools :
		#!/usr/bin/env python

		def genTools(maxIndex):
			print('// Get the macro name at index length(_0) :');
			print('#define GET_VARIADIC_MACRO(%s, NAME, ...)	NAME' % (', '.join([('_%d' % s) for s in range(maxIndex)])));
			print('// Expand sub-macros before sending to variadic ... :');
			print('#define GET_VARIADIC_MACRO_EXPAND(...)		GET_VARIADIC_MACRO(__VA_ARGS__)');
			print('// Break a sub-list of arguments :');
			print('#define MACRO_BREAK(...)				__VA_ARGS__');
			print('#define MACRO_EXPAND(MACRO, ...)			MACRO __VA_ARGS__');

		def genVarTools(maxIndex):
			print('// Extract only the variable name (the indirection helps expand contained macros) :');
			for k in range(maxIndex):
				print('#define EXTVAR_%d(%s)			%s' % (k, ', '.join([('_%d' % s) for s in range(k+2)]), '_%d' % (k+1)));
				print('#define EXTVARIND_%d(...)		EXTVAR_%d(__VA_ARGS__)' % (k, k));
			print('// Just variable names :');
			varlistind = ', '.join([('EXTVARIND_%d' % s) for s in range(maxIndex-2,-1,-1)]);
			for k in range(maxIndex):
				print('#define VARLIST_%d(%s)			%s' % (k, ', '.join([('_%d' % s) for s in range(k+1)]), ',\\\n\t\t\t\t'.join([('GET_VARIADIC_MACRO_EXPAND( MACRO_BREAK _%d, %s, ERROR) (MACRO_BREAK _%d)' % (s, varlistind, s)) for s in range(k+1)])));
			print('// Finally : ');
			print('#define VARLIST(...)				GET_VARIADIC_MACRO(__VA_ARGS__, %s) (__VA_ARGS__)' % ', '.join([('VARLIST_%d' % s) for s in range(k, -1, -1)]));

		def genArgTools(maxIndex):
			print('// Concatenate all to make types and variable names :');
			for k in range(maxIndex):
				print('#define CATFULL_%d(pre, post, %s)	pre %s post %s' % (k, ', '.join([('_%d' % s) for s in range(k+2)]), ', '.join([('_%d' % s) for s in range(k+1)]), '_%d' % (k+1)));
				print('#define CATFULLIND_%d(pre, post, ...)	CATFULL_%d(pre, post, __VA_ARGS__)' % (k, k));
			print('// Zip types and variable names :');
			arglistind = ', '.join([('CATFULLIND_%d' % s) for s in range(maxIndex-2,-1,-1)]);
			for k in range(maxIndex):
				print('#define ARGLIST_%d(pre, post, %s)	%s' % (k, ', '.join([('_%d' % s) for s in range(k+1)]), ',\\\n\t\t\t\t'.join([('GET_VARIADIC_MACRO_EXPAND( MACRO_BREAK _%d, %s, ERROR) (pre, post, MACRO_BREAK _%d)' % (s, arglistind, s)) for s in range(k+1)])));
			print('// Finally : ');
			print('#define ARGLIST(pre, post, ...)			GET_VARIADIC_MACRO(__VA_ARGS__, %s) (pre, post, __VA_ARGS__)' % ', '.join([('ARGLIST_%d' % s) for s in range(k, -1, -1)]));

		# Max arguments and max templates :
		maxIndex = 64;
		genTools(maxIndex);
		genVarTools(maxIndex);
		genArgTools(maxIndex);
	*/

